# import datetime
def string_diff(p,q,s):
	n = len(p)
	res = 0
	pres = -1
	
	# res = list()

	for l in range(n):
		# maxval = n-l
		# print(maxval)
		for k in range(n):
			# print(l,k)
			m,c = 0,0
			j = k
			i = l
			while(i<n and j<n):
				c+=1
				# print(c,end = ' ')
				# if c-1 == maxval:
				# 	return c-1
				if(p[i]!=q[j]):
					m+=1
				if(m>s):
					# res.append(c-1)
					pres = c-1
					if pres>res:
						pres,res = res,pres
					break
				i+=1
				j+=1
				if j==n:
					# res.append(c)
					pres = c
					if pres>res:
						pres,res = res,pres

	# return max(res)
	return res
print(string_diff('tabriz','torino',2))

